import React, { Component, useEffect, useState } from "react";
import axios from "axios";
import "./css_user.css";
import CardCar from "../component/card_car";
function HomeUser() {
  const [dataSoures, setdataSoures] = useState([]);
  const [user, setUser] = useState([]);

  useEffect(() => {
    const dataUser = JSON.parse(localStorage.getItem("user"));
    if (dataUser) {
      setUser(dataUser);
    }

    axios.get("http://localhost:3001/api/v1/motorcycles").then((response) => {
      console.log(response.data);
      var data = response.data.filter((f) => f.USER_ID == 6);
      setdataSoures(data);
    });
  }, []);

  return (
    <div>
      {dataSoures.map((i) => {
        return <CardCar key={i.MOTORCYCLE_ID}></CardCar>;
      })}
    </div>
  );
}

export default HomeUser;
